    def test_mark_played_item(self):
        """Test case for mark_played_item

        Marks an item as played for user.
        """
        query_string = [('datePlayed', '2013-10-20T19:20:30+01:00')]
        headers = { 
            'Accept': 'application/json',
            'CustomAuthentication': 'special-key',
        }
        response = self.client.open(
            '/Users/{user_id}/PlayedItems/{item_id}'.format(user_id='user_id_example', item_id='item_id_example'),
            method='POST',
            headers=headers,
            query_string=query_string)
        self.assert200(response,
                       'Response body is : ' + response.data.decode('utf-8'))

