    def test_on_playback_progress(self):
        """Test case for on_playback_progress

        Reports a user's playback progress.
        """
        query_string = [('mediaSourceId', 'media_source_id_example'),
                        ('positionTicks', 56),
                        ('audioStreamIndex', 56),
                        ('subtitleStreamIndex', 56),
                        ('volumeLevel', 56),
                        ('playMethod', openapi_server.PlayMethod()),
                        ('liveStreamId', 'live_stream_id_example'),
                        ('playSessionId', 'play_session_id_example'),
                        ('repeatMode', openapi_server.RepeatMode()),
                        ('isPaused', False),
                        ('isMuted', False)]
        headers = { 
            'CustomAuthentication': 'special-key',
        }
        response = self.client.open(
            '/Users/{user_id}/PlayingItems/{item_id}/Progress'.format(user_id='user_id_example', item_id='item_id_example'),
            method='POST',
            headers=headers,
            query_string=query_string)
        self.assert200(response,
                       'Response body is : ' + response.data.decode('utf-8'))

